import './App.css';
import { Home, Box } from './element';
import { BrowserRouter as Router, Match, Routes, Link, Nav } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
        <Match pattern='/' exactly component={Home} />
        <Match pattern='/box' exactly component={Box} />
      </Routes>
        <div className='menu-list'>
          <ul>
            <li><Link activeClassName='is-active' to="/">Home</Link></li>
            <li><Link activeClassName='is-active' to="/box">Box</Link></li>
          </ul>
        </div>
    </Router>
  );
}

export default App;
